import React from "react";
import ReactDOM from "react-dom";
//import './index.css';
import Test from "./test";
//import ReactCalendarBase from "./ReactCalendarBase";
import { BrowserRouter, Switch, Link, Route } from "react-router-dom";

//ReactDOM.render(<ReactCalendarBase />, document.querySelector("#root"));

import NewTitleBarClientDet from "../titleBars/titleBarNewClientDetails";
import NewClientConsolidate from "../newClientConsolidate";

ReactDOM.render(
  <BrowserRouter>
    <Test />

    <Switch>
      <Route
        path="/clients/newclient"
        exact
        render={() => (
          <div>
            <NewTitleBarClientDet />
            <NewClientConsolidate />
          </div>
        )}
      />
    </Switch>
  </BrowserRouter>,
  document.querySelector("#root")
);
